        material.transparent = true;
        material.opacity = 0;
        self.model.box = new THREE.Mesh( geometry, material );
        self.model.box.name = "MyBox";
        self.model.attach(self.model.box);
        self.model.box.position.y = 0.8;
        self.model.box.scale.set(0.5, 1, 0.5);
        self.model.position.set(self.position.x, self.position.y, self.position.z);
        self.lastPos = new THREE.Vector3().copy(self.model.position);
        self.model.rotation.set(0, self.rotation.y, 0);
        self.model.move = { forward: 0, left: 0 }
        self.model.lastMove = {};
        self.model.dirTarget = new THREE.Object3D()
        self.model.dirTarget.position.copy(self.model.position)
        self.camera.position.set(0, 2.5, -2)
